import React from "react";

const App = () => {
  let increment = setTimeout(() => {
    let nbreIncrementer = 0;
    nbreIncrementer++;
  }, 2000);
  (pixel => {
    document.body.style.background = "green";
    document.body.style.color = "white";
    document.body.style.fontSize = pixel;
    console.log(`90 + ${increment}px`);
  })(`90 + ${increment}px`);
  return <div>Hello</div>;
};

export default App;
